region      = "eu-west-1"
environment = "dev"

tags = {
  team        = "seller-experience"
  application = "finance"
}

rds_config = {
  instance_config = {
    identifier              = "seller-experience-finance"
    engine                  = "mysql"
    engine_version          = "8.0.32"
    family                  = "mysql8.0"
    instance_class          = "db.t3.medium"
    storage_type            = "gp3"
    allocated_storage       = "20"
    multi_az                = false
    backup_retention_period = 1
    max_allocated_storage   = 0
  }
  database_config = {
    name        = "main"
    master_user = "masteruser"
    db_users    = ["admin"]
    port        = "3306"
  }
